    // 跟进方式
    followWay: function followWay(value) {
      var arr = ['', '电话', '微信', '客户到访', '上门拜访'];
      return arr[value];
    },
    // 跟进状态
    followStatus: function followStatus(value) {
      var arr = ['', '已电话', '已邀约', '邀约成功', '实际到访', '已签约', '已购卡'];
      return arr[value];
    }
  },
  methods: {
    onModalTest: function onModalTest() {
      this.aService.getListInfo(this.$searchQuery.id).subscribe();
    }
  }
};
